import React from "react";
import { Page, Text, View, Document, StyleSheet } from "react-pdf";
import Pdf from "react-to-pdf";

const PrintBill = ({ print }) => {
  return (
    <Document>
      <Page>
        <Text fixed>{print.customer}</Text>
      </Page>
    </Document>
  );
};

export default PrintBill;
